//[钓鱼]钓鱼概率package cn.mxz;public class FishProbabilityTemplet {	/** 	 * 鱼ID 	 */	private int id;	/** 	 * 鱼类类型id 	 */	private int fishType;	/** 	 * 类型内部权重 	 */	private int interiorWeight;	/** 	 * 是否在钓鱼活动开始时才会出现 	 */	private int isActivityOnly;	/** 	 * 日志 	 */	private String log;	/**	 * 鱼ID	 */	void setId(int id) {		this.id = id;	}	/**	 * 鱼ID	 */	public int getId() {		return this.id;	}	/**	 * 鱼类类型id	 */	void setFishType(int fishType) {		this.fishType = fishType;	}	/**	 * 鱼类类型id	 */	public int getFishType() {		return this.fishType;	}	/**	 * 类型内部权重	 */	void setInteriorWeight(int interiorWeight) {		this.interiorWeight = interiorWeight;	}	/**	 * 类型内部权重	 */	public int getInteriorWeight() {		return this.interiorWeight;	}	/**	 * 是否在钓鱼活动开始时才会出现	 */	void setIsActivityOnly(int isActivityOnly) {		this.isActivityOnly = isActivityOnly;	}	/**	 * 是否在钓鱼活动开始时才会出现	 */	public int getIsActivityOnly() {		return this.isActivityOnly;	}	/**	 * 日志	 */	void setLog(String log) {		this.log = log;	}	/**	 * 日志	 */	public String getLog() {		return this.log;	}}